import React from 'react';

const FooterComponent = () => {
    return (
        <div className="footer bg-light text-center text-muted py-3 shadow-sm">
            <footer className="footer">
                <p>&copy; {new Date().getFullYear()} ExcelR - Feb09 FullStack Batch Team-2 All rights reserved.</p>
            </footer>
        </div>
    );
}

export default FooterComponent;
